+*{
+    margin: 0;
+    padding: 0;
+    box-sizing: border-box;
+}
+body{
+    font-family: sans-serif,Helvetica,Arial;
+    overflow: hidden;
+
+}
+a{
+    text-decoration: none;
+}
+.main{
+    background-color: #f0f2f4;
+    height: 100vh;
+    width: 100%;
+    display: flex;
+}
+.nav{
+    position: relative;
+    flex-basis: 30%;
+    min-width: 250px;
+    height: 100%;
+    border-right: .1px solid gray;
+}
+.nav__header{
+    background: linear-gradient(
+45deg,#fd267a,#ff6036);
+    background-image: linear-gradient(
+45deg, rgb(253, 38, 122), rgb(255, 96, 54));
+    width: 100%;
+    display: flex;
+    overflow: hidden;
+}
+.nav__hearder--profile{
+    padding: 15px 10px;
+}
+.nav__hearder--profile a{
+    display: flex;
+    padding: 5px;
+    align-items: center;
+    color: #fff;
+    font-size: 12px;
+    flex-basis: 25%;
+    cursor: pointer;
+}
+.nav__hearder--profile img{
+    height: 1.5rem;
+    width: 1.5rem;
+    border-radius: 50%;
+    margin-right: 5px;
+}
+.nav__hearder--profile a:hover{
+    background-color: rgba(0,0,0,.32)!important;
+    border-radius: 36px;
+}
+.nav_content{
+    background-color: #fff;
+    padding: 10px;
+    height: 100%;
+    overflow: hidden;
+}
+.nav_content-button{
+    padding: 10px;
+}
+.nav-button{
+    border: none;
+    background-color: #fff;
+    font-weight: bold;
+    cursor: pointer;
+    margin-right: 10px;
+    margin-left: 5px;
+}
+.nav-active{
+    border-bottom: 3px solid #fd267a;
+}
+.nav__content-main{
+    overflow: scroll;
+    height: calc(100% - 90px);
+    width: 100%;
+    display: flex;
+    flex-wrap: wrap;
+}
+.nav__content-main  .connection{
+    position: relative;
+    cursor: pointer;
+}
+.nav__content-main  .connection img{
+    width: 100px;
+    height: 130px;
+    object-fit: cover;
+    margin: 10px;
+}
+.nav__content-main .connection .connection_span{
+    width: 90%;
+    white-space: pre-wrap;
+    position: absolute;
+    left: 15px;
+    bottom: 40px;
+    color: #fff;
+}
+.nav__content-main .connection .connection_span h3{
+    position: absolute;
+    font-size: 12px;
+    hyphens: none;
+    white-space: nowrap;
+    text-overflow: ellipsis;
+    overflow: hidden;
+    max-width: 80%;
+}
+
+
+.nav__content-main .messger{
+    height: 80px;
+    width: 100%;
+    display: flex;
+    cursor: pointer;
+}
+
+.nav__content-main .messger img{
+    width: 50px;
+    height: 50px;
+    object-fit: cover;
+    margin: 10px;
+    border-radius: 50%;
+}
+.nav__content-main .messger .connection_span{
+    font-size: 12px;
+    hyphens: none;
+   
+    white-space: nowrap;
+    text-overflow: ellipsis;
+    overflow: hidden;
+    max-width: 80%;
+}
+.nav__content-main .messger .messger-content {
+    margin: 10px;
+    padding: 5px;
+}
+.nav__content-main .messger .messger-content p {
+    color: grey;
+    font-size: 13px;
+    text-align: center;
+    padding: 5px;
+    hyphens: none;
+    white-space: nowrap;
+    text-overflow: ellipsis;
+    overflow: hidden;
+    width: 100%;
+    max-width: 80%;
+}
+::-webkit-scrollbar {
+    display: none;
+}
+.content{
+    height: 100%;
+    position: relative;
+    overflow: hidden; 
+    text-align: center;
+    flex-basis: 70%;
+}
+.content__profile{
+    position: absolute;
+    width: 300px;
+    background-color: #fff;
+    height: calc(100vh - 100px);
+    top: 50%;
+    left: 50%;
+    transform: translate(-50%, -50%);
+}
+.content__profile-imgs{
+    position: absolute;
+    left: 0;
+    top: 0;
+    z-index: 900;
+    width: 100%;
+    height: 100%;
+}
+.slide {
+    width: 100%;
+    height: 100%;
+    position: absolute;
+    top: 0;
+    left: 100%;
+    z-index: 10;
+    padding: 8em 1em 0;
+    background-size: cover;
+    background-position: 50% 50%;
+    transition: left 0s .75s;
+    
+}
+[id^="slide"]:checked + .slide {
+    left: 0;
+    z-index: 100;
+    transition: left .65s ease-out;
+}
+.menu {
+    position: absolute;
+    left: 0;
+    z-index: 900;
+    width: 100%;
+    bottom: 0;
+}
+
+.menu label {
+    cursor: pointer;
+    display: inline-block;
+    width: 16px;
+    height: 16px;
+    background: #fff;
+    border-radius: 50px;
+    margin: 0 .2em 1em;
+    transition: all .3s ease;
+}
+.menu label:hover {
+    background: red;
+}
+@media screen and (max-width: 760px) {
+    .nav{
+        display: none;
+    }
+}

